import { useState } from "react";
import { Link } from "react-router-dom";
const RegisterPage = () => {
    const [role,setRole]=useState('patient');
    const [emailid,setEmaiId]=useState('');
    const [password,setPassword]=useState('');
    const[firstName,setFirstName]=useState('');
    const[lastName,setLastName]=useState('');
    const [gender, setGender]=useState('');
    const [dateofbirth, setDateofBirth]=useState('');
    const [address, setAddress]=useState('');
    const [country, setCountry]=useState('');
    const [state, setState]=useState('');
    const [city, setCity]=useState('');
    const [pincode, setPincode]=useState('');
    const [doctorlic, setDoctorLic]=useState('');
    const [company, setCompany]=useState('');
    const [companyLic, setCompanyLic]=useState('');

  fetch('https://restcountries.com/v3.1/all')
    .then(response => response.json())
    .then(data => {
      const countrySelect = document.getElementById('country');

      // Sort countries alphabetically by common name
      data.sort((a, b) => {
        const nameA = a.name.common.toUpperCase();
        const nameB = b.name.common.toUpperCase();
        return nameA.localeCompare(nameB);
      });

      // Populate the dropdown with sorted country names
      data.forEach(country => {
        const option = document.createElement('option');
        option.value = country.name.common;
        option.text = country.name.common;
        countrySelect.add(option);
      });
    })
    .catch(error => console.error('Error fetching countries:', error));
//
    const renderInputForm = () => {
        if (role === 'patient') {
          return;
        } else if (role === 'doctor') {
          return (
            <div className="doctor-info">
            <p>Doctor Information</p>
            <label>License Number</label>
            <input 
            type="text" 
            required 
            value={doctorlic}
               onChange={(e)=>setDoctorLic(e.target.value)}/>
            </div>
          );
        } else if (role === 'insuranceProvider') {
          return (
            <div className="insurance-provider">
            <p>Insurance Information</p>
            <label>Insurance Company</label>
            <input 
            type='text'
            required 
            value={company}
            onChange={(e)=>setCompany(e.target.value)}/>
            <label>License Number</label>
            <input 
            type="text" 
            required 
            value={companyLic}
            onChange={(e)=>setCompanyLic(e.target.value)}/>
            </div>
          );
        } else {
          return null;
        }
      };
    return ( 
         <div className="register-page">
            <div className="content">
               <form>
               <label>Select User Type</label>
               <select 
               value={role}
               onChange={(e)=>setRole(e.target.value)}>
                <option value="patient">Patient</option>
                <option value="doctor">Doctor</option>
                <option value="insuranceProvider">Insurance Provider </option>
               </select>
               <p>Account Information</p>
               <div className="account-info">


               <input 
               type="email" 
               required
               placeholder="Email Address"
               value={emailid}
               onChange={(e)=>setEmaiId(e.target.value)}/>

               <input 
               type="password" 
               required
               placeholder="Password"
               value={password}
               onChange={(e)=>setPassword(e.target.value)}/>
               </div>
               <p>Personal Information</p>
               <div className="personal-info">

               <input 
               type="text" 
               required 
               placeholder="First Name"
               value={firstName}
               onChange={(e)=>setFirstName(e.target.value)}/>

               <input 
               type="text"
               placeholder=""
                required 
                value={lastName}
               onChange={(e)=>setLastName(e.target.value)}/>
               <label>Gender</label>
               <select
               value={gender}
               onChange={(e)=>setGender(e.target.value)}>
                <option value="male">Male</option>
                <option value="female">Female</option>
                <option value="other">Other</option>
               </select>
               <label >Date of Birth</label>
               <input 
               type="date" 
               required
               value={dateofbirth}
               onChange={(e)=>setDateofBirth(e.target.value)} />
               <label>Street Address required</label>
               <input 
               type="text"
               required
               value={address}
               onChange={(e)=>setAddress(e.target.value)} />
               <label >Country</label>
               <select 
               id="country" 
               required
               value={country}
               onChange={(e)=>setCountry(e.target.value)}></select>
               <label >State</label>
               <input 
               type="text" 
               required
               value={state}
               onChange={(e)=>setState(e.target.value)}/>
               <label >City</label>
               <input 
               type="text" 
               required
               value={city}
               onChange={(e)=>setCity(e.target.value)}/>
               <label >Pincode</label>
               <input 
               type="number" 
               required
               value={pincode}
               onChange={(e)=>setPincode(e.target.value)}/>
               </div>


               {renderInputForm()}

               <button>Register</button>
               </form>
               <footer>
                <p><Link to="/">Back to Homepage</Link>.</p>
            </footer>
            </div>
         </div>
     );
}

export default RegisterPage;
